About haxephp (Haxe and PHP)One of the earlier targets added to the Haxe compiler is PHP.
It was create by Franco Ponticelli and added to the Haxe compiler in 2008.What is PHP?PHP is a server-side scripting language designed for web development but also used as a general-purpose programming language. Originally created by Rasmus Lerdorf in 1994,[3] the PHP reference implementation is now produced by The PHP Group.[4] PHP originally stood for Personal Home Page,[3] but it now stands for the recursive backronym PHP: Hypertext Preprocessor.[5]Source: wikipediaSpares information about PHP on Haxe.orghttp://haxe.org/manual/target-php-getting-started.htmlConvert PHP to HaxePhpToHaxe - tool for helping use PHP from Haxehttp://phptohaxe.haqteam.com/code.phpNeko?In the source you will see this conditional compiler statement#if php
import php.Lib;
import php.Web;
#elseif neko
import neko.Lib;
import neko.Web;
#end
What is that neko?Neko is a high-level dynamically typed programming language.Note that the php package tries to mimic as far as possible the neko one. This allows for easy switching between the two platformsneko apiAn Introduction to Mod_nekoMod_neko is an Apache module for Neko. This means it's possible to run Neko programs on the server side to serve web-pages using Apache. Here's a step-by-step tutorial on how to configure and use Mod_neko.Read more Mod_neko.

